import React from "react";
import AwesomeSlider from 'react-awesome-slider';
import 'react-awesome-slider/dist/styles.css';
import img from "../src/images/slide-1.png"

const Slider = () => {
    return (
        <>
  <AwesomeSlider>
    <div data-src={img} />
    <div data-src={img} />
    <div data-src={img} />
  </AwesomeSlider>
  </>
);
    }

export default Slider;
